class AddNewItem {

    constructor(date, firstname,lastname, number) {
        this.id = Math.random().toString(36).substring(7);
        this.firstname = firstname;
        this.lastname = lastname;
        this.number = number;
        this.date = date;

    }


    static fromJSON (json) {
        let toDoItem = new AddNewItem();
        toDoItem.id = json.id;
        toDoItem.date = json.date;
        toDoItem.firstname = json.firstname;
        toDoItem.lastname = json.lastname;
        toDoItem.number = json.number;

        return toDoItem;
    }
}

export default AddNewItem;
